import React from "react";
import AddRandomContact from "./AddRandomContact";
import RemoveAllContact from "./RemoveAllContact";
import AddContact from "./AddContact";
import Footer from "../Layout/Footer";
import Header from "../Layout/Header";
import GeneralContacts from "./GeneralContacts";
import FavoriteContacts from "./FavoriteContacts";

class ContactIndex extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      contactList: [
        {
          id: 1,
          name: "dimitris leve",
          phone: "123456789",
          email: "Alexkr21@dotnet.com",
          isFavorite: false,
        },
        {
          id: 2,
          name: "Nikos Ampatzis",
          phone: "123456781",
          email: "NikosAmp@dotnet.com",
          isFavorite: true,
        },
        {
          id: 3,
          name: "Tax Klouras",
          phone: "123456782",
          email: "TaxKlouras@dotnet.com",
          isFavorite: true,
        },
      ],
      selectedContact: undefined,
      isUpdating: false,
    };
  }

  handleAddContact = (newContact) => {
    if (newContact.name === "") {
      return { status: "failure", msg: "Please Enter a valid name" };
    } else if (newContact.phone === "") {
      return { status: "failure", msg: "Please Enter a valid phone" };
    }
    const duplicateRecord = this.state.contactList.filter((x) => {
      return x.name === newContact.name && x.phone === newContact.phone;
    });
    if (duplicateRecord.length > 0) {
      return { status: "failure", msg: "Duplicate Record" };
    } else {
      const newFinalContact = {
        ...newContact,
        id: this.state.contactList[this.state.contactList.length - 1].id + 1,
        isFavorite: false,
      };
      this.setState((prevState) => {
        return {
          contactList: prevState.contactList.concat([newFinalContact]),
        };
      });
      return { status: "success", msg: "Contact was added successfully" };
    }
  };

  handleToggleFavorites = (contact) => {
    this.setState((prevState) => {
      return {
        contactList: prevState.contactList.map((obj) => {
          if (obj.id === contact.id) {
            return { ...obj, isFavorite: !obj.isFavorite };
          }
          return obj;
        }),
      };
    });
  };

  handleToggleContact = (contactId) => {
    this.setState((prevState) => {
      return {
        contactList: prevState.contactList.filter((obj) => obj.id !== contactId),
      };
    });
  };

  handleAddRandomContact = (newContact) => {
    const newFinalContact = {
      ...newContact,
      id: this.state.contactList[this.state.contactList.length - 1].id + 1,
      isFavorite: false,
    };
    this.setState((prevState) => {
      return {
        contactList: prevState.contactList.concat([newFinalContact]),
      };
    });
  };

  handleRemoveAllContact = () => {
    this.setState(() => {
      return {
        contactList: [],
      };
    });
  };

  handleUpdateClick = (contact) => {
    this.setState(() => {
      return {
        selectedContact: contact,
        isUpdating: true,
      };
    });
  };

  render() {
    return (
      <div>
        <Header />
        <div className="container" style={{ minHeight: "85vh" }}>
          <div className="row py-3">
            <div className="col-md-4">
              <AddRandomContact handleAddRandomContact={this.handleAddRandomContact} />
            </div>
            <div className="col-md-4">
              <RemoveAllContact handleRemoveAllContact={this.handleRemoveAllContact} />
            </div>
            <div className="col-md-4">
              <AddContact
                isUpdating={this.state.isUpdating}
                selectedContact={this.state.selectedContact}
                handleAddContact={this.handleAddContact}
              />
            </div>
          </div>
          <div className="row py-2">
            <div className="col-md-12">
              <FavoriteContacts
                contacts={this.state.contactList.filter((u) => u.isFavorite)}
                favoriteClick={this.handleToggleFavorites}
                deleteContact={this.handleToggleContact}
                updateClick={this.handleUpdateClick}
              />
            </div>
          </div>
          <div className="row py-2">
            <div className="col-md-12">
              <GeneralContacts
                contacts={this.state.contactList.filter((u) => !u.isFavorite)}
                favoriteClick={this.handleToggleFavorites}
                deleteContact={this.handleToggleContact}
                updateClick={this.handleUpdateClick}
              />
            </div>
          </div>
        </div>
        <Footer />
      </div>
    );
  }
}

export default ContactIndex;
